import { Box, CssBaseline } from "@mui/material";
import Footer from "./pages/Footer";
import Header from "./pages/Header";
import Navbar from "./pages/Navbar";

function App() {
  return (
    <>
      <CssBaseline />
      <Box sx={{ height: "100vh" }}>
        <Navbar />
        <Header />
        <Footer />
      </Box>
    </>
  );
}

export default App;
